import React, { useState } from "react";
import { Modal } from "atomize";

const NetflixModal = ({ isOpen, onClose }) => {

  return(
    <Modal
      isOpen={isOpen}
      onClose={onClose}
      rounded="sm"
      maxW="48rem"
    >

    </Modal>
  )
}

export default NetflixModal;
